static void transform_angj(double *jmm_angj, double *angj, int lj, int lc)
{
        const int lj1 = lj + 1;
        const int dlc = lc * 2 + 1;
        const int ljlc1 = lj + lc + 1;
        const int nfj = (lj+1) * (lj+2) / 2;
        double *jmm;

        const double D0 = 0;
        const double D1 = 1;
        const char TRANS_N = 'N';

        int i, j;
        for (i = 0; i < 3; i++) {
                jmm = _angular_moment_matrix[lc] + i*dlc*dlc;
                for (j = 0; j < lj1*nfj; j++) {
                        dgemm_(&TRANS_N, &TRANS_N, &ljlc1, &dlc, &dlc,
                               &D1, angj+j*dlc*ljlc1, &ljlc1, jmm, &dlc,
                               &D0, jmm_angj+j*dlc*ljlc1, &ljlc1);
                }
                jmm_angj += lj1 * nfj * dlc * ljlc1;
        }
}

/*
 * exponentially scaled modified spherical Bessel function of the first kind
 * scipy.special.sph_in(order, z) * numpy.exp(-z)
 *
 * JCC, 27, 1009
 */
void ECPsph_ine(double *out, int order, double z)
{
        int i, k;
        if (z < 1e-7) {
                // (1-z) * z^l / (2l+1)!!
                out[0] = 1. - z;
                for (i = 1; i <= order; i++) {
                        out[i] = out[i-1] * z / (i*2+1);
                }
        } else if (z > 16) {
                // R_l(z) = \sum_k (l+k)!/(k!(l-k)!(2x)^k)
                double z2 = -.5 / z;
                double ti, s;
                for (i = 0; i <= order; i++) {
                        ti = .5 / z;
                        s = ti;
                        for (k = 1; k <= i; k++) {
                                ti *= z2;
                                s += ti * _factorial[i+k]
                                        / (_factorial[k] * _factorial[i-k]);
                        }
                        out[i] = s;
                }
        } else {
                // z^l e^{-z} \sum (z^2/2)^k/(k!(2k+2l+1)!!)
                double z2 = .5 * z * z;
                double t0 = exp(-z);
                double ti, s, next;
                for (i = 0; i <= order; i++) {
                        ti = t0;
                        s = ti;
                        for (k = 1;; k++) {
                                ti *= z2 / (k * (k*2+i*2+1));
                                next = s + ti;
                                if (next == s) {
                                        break;
                                } else {
                                        s = next;
                                }
                        }
                        t0 *= z/(i*2+3);  // k = 0
                        out[i] = s;
                }
        }

}


