void ECPscalar_distribute(double *out, double *gctr, const int *dims,
                          const int comp, const int di, const int dj)
{
        const int dij = di * dj;
        int i, j, ni, icomp;
        if (dims == NULL) {
                for (i = 0; i < dij * comp; i++) {
                        out[i] = gctr[i];
                }
        } else {
                ni = dims[0];
                for (icomp = 0; icomp < comp; icomp++) {
                        for (i = 0; i < di; i++) {
                        for (j = 0; j < dj; j++) {
                                out[i+j*ni] = gctr[i+j*di];
                        } }
                        out += dims[0] * dims[1];
                        gctr += dij;
                }
        }
}
void ECPscalar_distribute0(double *out, const int *dims,
                           const int comp, const int di, const int dj)
{
        const int dij = di * dj;
        int i, j, ni, icomp;
        if (dims == NULL) {
                for (i = 0; i < dij * comp; i++) {
                        out[i] = 0;
                }
        } else {
                ni = dims[0];
                for (icomp = 0; icomp < comp; icomp++) {
                        for (i = 0; i < di; i++) {
                        for (j = 0; j < dj; j++) {
                                out[i+j*ni] = 0;
                        } }
                        out += dims[0] * dims[1];
                }
        }
}


